import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const styles = {
  root: {
    width: '100%',
    overflowX: 'auto',
  },
  table: {
    minWidth: 700,
  },
};

let id = 0;
function createData(name, runStatus, changeTime) {
  id += 1;
  return { id, name, runStatus, changeTime };
}

const data = [
  createData('任务-1', '已完成', '2018-1-12'),
  createData('检测本地资产', '已完成', '2018-1-12'),
  createData('远程检查', '运行中', '2018-1-12'),
  createData('测试任务-2', '已暂停', '2018-1-12'),
  createData('测试任务-10', '已完成', '2018-1-12'),
];

function TaskTable(props) {
  const { classes } = props;

  return (
    <Paper className={classes.root}>
      <Table className={classes.table}>
        <TableHead>
          <TableRow>
            <TableCell>任务序号</TableCell>
            <TableCell align="right">任务名称</TableCell>
            <TableCell align="right">运行状态</TableCell>
            <TableCell align="right">修改时间</TableCell>
            <TableCell align="right">查看任务结果</TableCell>
            <TableCell align="right">操作</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map(n => (
            <TableRow key={n.id}>
              <TableCell component="th" scope="row">
                {n.id}
              </TableCell>
              <TableCell align="right">{n.name}</TableCell>
              <TableCell align="right">{n.runStatus}</TableCell>
              <TableCell align="right">{n.changeTime}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Paper>
  );
}

TaskTable.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(TaskTable);
